// Modal.jsx

import { IoClose } from "react-icons/io5";

const Modal = ({ isOpen, onClose, children }) => {
  return (
    <div className="modal-overlay">
      <div className="modal">
        <button className="modal-close">
          <IoClose />
        </button>
        {children}
      </div>
    </div>
  );
};

export default Modal;
